  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:45.639302\",\n\t\"name\": \"alaska-yukon-waterfowl-breeding-population-survey\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Alaska-Yukon was again blessed with a generally
  widespread, early spring break-up in the interior and on the North Slope with perhaps
  a more normal spring phenology on the western tundra. Overall, there was little
  flooding and habitat conditions should be basically favorable for waterfowl production
  throughout most of the Alaska-Yukon waterfowl nesting habitat.    Generally, duck
  populations increased in size from 1997. Changes in duck populations by category
  are as follows. Dabblers are up 41 % from last year, are 56% above the 10-year average,
  and are 117% above the long-term mean. Divers are up 23 % from 1997, up 3 % from
  the 10-year average, and are up 10% from the long-term mean. Miscellaneous are up
  39% from 1997, down 2% from the 10-year average, but are down 16% from the long-term
  mean. Total ducks are up 37% from 1997, up 36% from the 10-year average, and are
  59% above the long-term mean.    Overall, goose production should be above average
  in the interior but only average on the western tundra.    Trumpeter swan production
  should be above average throughout most of Alaska. Tundra swan production should
  be perhaps only average on the western tundra and above average on the North Slope.\",\n\t\"license_title\":
